//****STRUCT DECLARATION****
struct Sprite{
	uint16_t x; //Current x
	uint16_t y; //Current y
	const unsigned short *bitmap;
	uint16_t w; //Width of bitmap
	uint16_t l; //Length of bitmap
	uint8_t cType; //Type of Collision
	//Actual sprite occupies space w - 2dx, l - 2dy
};
typedef struct Sprite Sprite;
typedef struct Sprite Sprites[];

struct rect{
	uint16_t x;
	uint16_t y;
	uint16_t w;
	uint16_t h;
	uint16_t colour;
};
typedef struct rect rect;

struct LevelRects{
	rect rects[30];
	uint8_t size;
};
typedef struct LevelRects LevelRects;

struct Bullet{
	Sprite *image;
	uint8_t v; //velocity
	int8_t dir; //direction
	uint8_t min, max;
	uint8_t movesickness;
};
typedef struct Bullet Bullet;

struct LevelBullets{
	Bullet *Bullets[10];
	uint8_t size;
};
typedef  struct LevelBullets LevelBullets;

struct mPlatform{
	Sprite *image;
	uint8_t movement;	//Determines whether its moving
	uint8_t axis;
	int8_t dir;		//Determine direction of current motion
	uint8_t min, max;
	uint8_t standing1, standing2;
	uint8_t moveSickness;
};
typedef struct mPlatform mPlatform;

struct Button{
	Sprite *image;
	mPlatform *triggered;
	uint8_t cSprite;
	uint8_t active;
};
typedef struct Button Button;

struct LevelButtons{
	Button *Buttons[10];
	uint8_t size;
};
typedef struct LevelButtons LevelButtons;

struct LevelmPlatforms{
	mPlatform *mPlatform[10];
	uint8_t size;
};
typedef struct LevelmPlatforms LevelmPlatforms;

struct Stage{
	//Way to create map, stores all platforms are rectangles
	LevelRects *LevelRects;
	//Stores all moving parts
	LevelBullets *LevelBullets;
	LevelmPlatforms *LevelmPlatforms;
	LevelButtons *LevelButtons;
};
typedef struct Stage Stage;

struct Player{
	Sprite *image;
	int8_t jumpI; // Progress of Jump
	int8_t jumpDir; //Whether jump is going up or down
	uint8_t jumpFlag;
	uint8_t moveSickness;
	uint8_t jumpSickness;
	uint8_t colour;
	uint8_t jumpButton;
	Button *heldButton;
	int8_t facing;
};
typedef struct Player Player;
