//initialize inputs for controllers of P1 and P2
void ControllerButton_Init(void){
	SYSCTL_RCGCGPIO_R |= 0x2;
	volatile uint32_t delay=0;
	GPIO_PORTB_AFSEL_R &= ~buttons;
	GPIO_PORTB_AMSEL_R &= ~buttons;
	GPIO_PORTB_DIR_R &= ~buttons;
	GPIO_PORTB_PDR_R |= buttons;
	GPIO_PORTB_DEN_R |= buttons;
}


// Initialize Port F so PF1, PF2 and PF3 are heartbeats
void PortF_Init(void){
	volatile unsigned long delay=0;
	SYSCTL_RCGCGPIO_R |= 0x20;   
  delay = SYSCTL_RCGCGPIO_R;         //allow time for clock to stabilize
	delay = 42;
  GPIO_PORTF_AFSEL_R &=~0xE;     
  GPIO_PORTF_AMSEL_R &=~0xE;
	GPIO_PORTF_DIR_R   |= 0xE;      //make
	GPIO_PORTF_DEN_R   |= 0xE;
}






//*****COLLLISSSIONSSSSS*****
//draw rectangle (x,y) is top left
//	if (rect1.x < rect2.x + rect2.width &&
//   rect1.x + rect1.width > rect2.x &&
//   rect1.y < rect2.y + rect2.height &&
//   rect1.height + rect1.y > rect2.y) {
//    // collision detected!
//}
uint8_t Rect_Collision(rect rect1, rect rect2){
	if (rect1.x < rect2.x + rect2.w && rect1.x + rect1.w > rect2.x && rect1.y < rect2.y + rect2.h &&
   rect1.h + rect1.y > rect2.y){
		 return 1;
	 }	
	return 0;
}


//draw bitmap/sprite (x,y) bottom left
//if (sprite1.x < sprite2.x + sprite2.width &&
//   sprite1.x + sprite1.width > sprite2.x &&
//   sprite1.y < sprite2.y - sprite2.height &&
//   sprite1.height - sprite1.y > sprite2.y) {
//    // collision detected
uint8_t Sprite_Collision(Sprite sprite1, Sprite sprite2){
	uint8_t collisionX = (sprite1.x+  sprite1.w)> sprite2.x &&(sprite2.x + sprite2.w) > sprite1.x;
	uint8_t collisionY = (sprite1.y - sprite1.l) < sprite2.y && (sprite2.y - sprite2.l) < sprite1.y;
	
	return collisionX && collisionY;
}
	
// do both (sprite vs Rectangle)
//if (sprite1.x < rect2.x + rect2.width &&
//   sprite1.x + sprite1.width > rect2.x &&
//   sprite1.y - sprite.length < rect2.y + rect2.height &&
//   sprite1.y > rect2.y) {
//    // collision detected!
uint8_t SpriteRect_Collision(Sprite sprite1, rect rect1){
	
	if (sprite1.x <= rect1.x + rect1.w && sprite1.x + sprite1.w >= rect1.x && sprite1.y > rect1.y - 1 && sprite1.y - sprite1.l <= rect1.y + rect1.h) {
			 return 1;
		 }	 
	return 0;

}



//Checks two sprites to see if one is preventing another from falling
uint8_t Sprite_Gravity(Sprite sprite1, Sprite sprite2){
	uint8_t collisionX = (sprite1.x+  sprite1.w)>= sprite2.x &&(sprite2.x + sprite2.w) >= sprite1.x;
	uint8_t collisionY = (sprite1.y - sprite1.l) <= sprite2.y && (sprite2.y - sprite2.l) <= sprite1.y;
	
	return collisionX && collisionY;
}

//Checks a sprite is on a platform or not
uint8_t Platform_Gravity(Sprite sprite1, rect platform){
	uint8_t collisionX = (sprite1.x+  sprite1.w)>= platform.x &&(platform.x + platform.w) >= sprite1.x;
	uint8_t collisionY = sprite1.y >= platform.y - 1 && sprite1.y <= platform.y + platform.h;
	
	return collisionX && collisionY;
}
//Takes a sprite input and a playerNum if valid
//Checks that sprite against all other sprites on the level
//Returns -1 if no collision, or the adress of the collision in the level sprites arrray
Sprite* Collision_Checker_Sprite(Sprite *sprite, uint8_t playerNum){
	uint8_t i;
	if(playerNum == 1){
		if(Sprite_Collision(*sprite, *levelSprites[1])){
			return levelSprites[1];
		}
	}
	else if(playerNum == 2)
		if(Sprite_Collision(*sprite, *levelSprites[0])){
			return levelSprites[0];
		}
	for(i = 2;i < lSpritesSize; i ++)
		if(Sprite_Collision(*sprite, *levelSprites[i]))
			return levelSprites[i];
		
	return sprite;
}

int8_t Collision_Checker_Platform(Sprite *sprite){
	uint8_t i;
	LevelRects *temp = Levels[cLevel][cStage].LevelRects;
	for(i = 0; i < temp->size; i++)
		if(SpriteRect_Collision(*sprite, temp->rects[i]))
			return i;
	if(SpriteRect_Collision(*sprite, LeftBorder))
		return leftBorder;
	else if(SpriteRect_Collision(*sprite, TopBorder))
		return topBorder;
	return -1;
}
//Handles the collision with sprites based on the collision type
void Collision_Handlers_Sprite(Player *Collided, Sprite *Collidee, uint8_t axis, int8_t dir, uint8_t playerNum){
	uint8_t handleValue = (*Collidee).cType;
	if(handleValue == playerC){
		PlayerC_Handler(Collided, Collidee, axis, dir);
		if(axis)
			Change_Sound(8);
	}
	else if(handleValue == platformC)
		mPlatformC_Handler(Collided, Collidee, axis, dir, playerNum);
	else if(handleValue == bulletC)
		BulletC_Handler(Collided, Collidee, axis, dir);
	else if(handleValue == buttonC1)
		ButtonC1_Handler(Collided, Collidee, axis, dir);
	else if(handleValue == buttonC2)
		ButtonC2_Handler(Collided, Collidee, axis, dir);
	else
		ButtonC3_Handler(Collided, Collidee, axis, dir);
}

//Handles the collision with platform based on the collided rect
void Collision_Handler_Platform(Player *Collided, int8_t platformNum, uint8_t axis, int8_t dir){
	if(axis == xAxis){
		Collided->moveSickness = 0;
		Collided->image->x += -dir;
	}
	else{
		rect Collidee;
		if(platformNum == topBorder)
			Collidee = TopBorder;
		else
			Collidee = Levels[cLevel][cStage].LevelRects->rects[platformNum];
		if(dir == -1)
			Collided->image->y = Collidee.y - 1;
		else{
			Collided->image->y = Collidee.y + Collidee.h + 17;
		}
		
		Colour_Check(Collided, &Collidee);
		Jump_Reset(Collided);
	}
}

void Colour_Check(Player *player, rect *platform){
	if(player->colour == blue && platform->colour == RED)
			Game_Over();
		else if(player->colour == red && platform->colour == BLUE)
			Game_Over();
		else if(platform->colour == GREEN)
			Game_Over();
}
//*****Collision Handlers******
void PlayerC_Handler(Player *Collided, Sprite *Collidee, uint8_t axis, int8_t dir){
	if(axis == xAxis){
		Collided->moveSickness = 0;
		Collided->image->x += -dir;
	}
	else{
		if(dir == -1)
			Collided->image->y = Collidee->y - Collidee->l;
		else
			Collided->image->y = Collidee->y + Collided->image->l-3;
		Jump_Reset(Collided);
	}
}
void mPlatformC_Handler(Player *Collided, Sprite *Collidee, uint8_t axis, int8_t dir, uint8_t playerNum){
	PlayerC_Handler(Collided, Collidee, axis, dir);
	if(axis){
		if(Collidee->bitmap == &VerticalPlatform[0]){
			if(Collided->image->y > Collidee->y)
				Game_Over();
		}
		else if (dir == -1){
			uint8_t i, x = 11;
			LevelmPlatforms *levelPlats = Levels[cLevel][cStage].LevelmPlatforms;
			for(i = 0; (x==11) && i < levelPlats->size; i ++)
				if(Collidee == levelPlats->mPlatform[i]->image)
					x = i;
			mPlatform *plat = levelPlats->mPlatform[x];
			
				if(playerNum == 1)
					plat->standing1 = 1;
				else
					plat->standing2 = 1;
		}
		else{
			Collided->image->y += 2;
			Draw_Sprite(Collidee);
		}
	}
}
