void Collisions(Player *Collided, uint8_t playerNum, uint8_t axis, int8_t dir){
	Sprite *collision;
	int8_t pCollision;
	collision = Collision_Checker_Sprite(Collided->image, playerNum);
	if(collision != Collided->image)
		Collision_Handlers_Sprite(Collided, collision, axis, dir, playerNum);
	else{
		pCollision = Collision_Checker_Platform(Collided->image);
		if(pCollision != -1)
			Collision_Handler_Platform(Collided, pCollision, axis, dir);
	}
}
//Change player's movement into jump motion vertically
void jump(Player *player){
	(*(*player).image).y += -jumpArr[(*player).jumpI];
	Change_Sound(2);
	if((*player).jumpI == 18)
		Gravity_Start(player);
	else
		(*player).jumpI ++;
}


//Resets player to horizontal sprite after touching the ground
void Jump_Reset(Player *player){
	player -> jumpDir = 1;
	player -> jumpI = 0;
	player -> jumpFlag = 0;
	player -> jumpSickness = 0;
	
	Change_Sprite(player, Right[player->colour]);
	
}

//Handles player gravity
void Gravity(Player *player){
	(*(*player).image).y += jumpArr[(*player).jumpI];
	if((*player).jumpI != 0)
		(*player).jumpI --;
}

//Called to reset gravity to the start of gravity state
//I.e. the beginning of the parabolic motion
void Gravity_Start(Player *player){
	(*player).jumpDir = -1;
	Change_Sprite(player, JumpDown[player->colour]);
	player->jumpFlag = 0;
	player->jumpI = 18;
}

//Check if gravity is valid
//Essentially a collision checker but checks under you
uint8_t Gravity_Check(Player *player, uint8_t playerNum){
	uint8_t i = 0;
	if(playerNum == 1){
		if(Sprite_Gravity(*player->image, *levelSprites[1]))
			return 0;
	}
	else if(playerNum == 2){
		if(Sprite_Gravity(*player->image, *levelSprites[0]))
			return 0;
	}
	
	for(i = 2; i < lSpritesSize; i ++){
		if(Sprite_Gravity(*player->image, *levelSprites[i]))
			return 0;
	}
	
	for(i = 0; i <  Levels[cLevel][cStage].LevelRects->size; i ++){
		if(Platform_Gravity(*player->image, Levels[cLevel][cStage].LevelRects->rects[i])){
			Colour_Check(player, &Levels[cLevel][cStage].LevelRects->rects[i]);
			return 0;
		}
	}
	return 1;
}

#define FrameRate 60
#define delayReload FrameRate/2
//set frame rate of game (frequency of updates/ rendering)
void FrameRateDelay (uint16_t HZ){
	uint16_t n = 1000/HZ, time;	
	while(n){
    time = 72724*2/91;  // 1msec, tuned at 80 MHz
    while(time){
	  	time--;
    }
    n--;
  }
}


