//Create level on screen
void Generate_Level(uint8_t level, uint8_t stage){
	ST7735_FillScreen(0xFFFF);
	Change_Rect(&TopBorder, 0,0,128,5,0);
	Change_Rect(&LeftBorder, 0,0,2,160,0);
	Stage *rendStage = &(Levels[level][stage]);
	uint8_t i, buttonSize = rendStage->LevelButtons->size, platformSize = rendStage->LevelmPlatforms->size, bulletSize = rendStage->LevelBullets->size;
	for(i = 0; i < rendStage->LevelRects->size; i++)
		Draw_Rect(&(rendStage->LevelRects->rects[i]));
	Draw_Rect(&LeftBorder);
	Draw_Rect(&TopBorder);
	Draw_Sprite(Player1.image);
	Draw_Sprite(Player2.image);
	levelSprites[0] = Player1.image;
	levelSprites[1] = Player2.image;
	Sprite *temp;
	lSpritesSize = 2;
	for(i = 0; i < buttonSize; i ++){
		temp = rendStage->LevelButtons->Buttons[i]->image;
		temp->bitmap = &ButtonUnpressed[0];
		Draw_Sprite(temp);
		levelSprites[i+lSpritesSize] = temp;
	}
	lSpritesSize += buttonSize;
	mPlatform *temp2;
	for(i = 0; i < platformSize; i ++){
		temp = rendStage->LevelmPlatforms->mPlatform[i]->image;
		temp2 = rendStage->LevelmPlatforms->mPlatform[i];
		if(temp2->axis){
			if(temp->y != temp2->min){
				temp->y = temp2->min;
				if(!temp2->movement)
					temp2->dir = -temp2->dir;
				else
					temp2->movement = 0;
			}
		}
		else{
			if(temp->x != temp2->min){
				temp->x = temp2->min;
				if(!temp2->movement)
					temp2->dir = -temp2->dir;
				else
					temp2->movement = 0;
			}
		}
		Draw_Sprite(temp);
		levelSprites[i+lSpritesSize] = temp;
	}
	lSpritesSize += platformSize;
	for(i = 0; i < bulletSize; i++){
		temp = rendStage->LevelBullets->Bullets[i]->image;
		Draw_Sprite(temp);
		levelSprites[i+2+buttonSize+platformSize] = temp;
	}
	lSpritesSize += bulletSize;
	FrameRateDelay(1);
}


