void Move_Player(Player *Player, uint8_t playerNum){
	xAxis_Move(Player, playerNum);
	Jump_Player(Player, playerNum);
	Draw_Sprite((*Player).image);
	if(Player->image->x + Player->image->w > 128)
		Next_Level();
	
}

void xAxis_Move(Player *Player, uint8_t playerNum){
	ADC_In89(ADCData);
	uint32_t move = ADCData[2-playerNum];
	int8_t dir = 0;
	if((*Player).moveSickness == 0){
		if(move <  1536){
		(*(*Player).image).x += -1;
		(*Player).moveSickness = 4;
		dir = -1;
		if(!Player->jumpFlag && Player->facing == right && !(Player->jumpDir == -1))
			Change_Sprite(Player, Left[Player->colour]);
			Player->facing = left;
		}
		else if(move > 2560){
		(*(*Player).image).x += 1;
		(*Player).moveSickness = 4;
		dir = 1;
		if(!Player->jumpFlag && Player->facing == left && !(Player->jumpDir == -1)){
			Player->facing = right;
			Change_Sprite(Player, Right[Player->colour]);
			}
		}
	}
	else
		(*Player).moveSickness --;
	Collisions(Player, playerNum, xAxis, dir);
	if(gameOverFlag == 0){
		gameOverFlag = 1;
		return;
	}
}
void Jump_Player(Player *Player, uint8_t playerNum){
	if((*Player).jumpSickness == 0){
			if(Player->jumpDir && !Player->jumpFlag){
				if(Gravity_Check(Player, playerNum)){
					Gravity_Start(Player);
					Gravity(Player);
					if(Player->heldButton != 0){
						Player->heldButton->active --;
						if(!Player->heldButton->active){
							Player->heldButton->triggered->movement = 1;
							Player->heldButton->triggered->dir = -Player->heldButton->triggered->dir;
							Change_Button_Bitmap(Player->heldButton->image, 0);
						}
						Player->heldButton = 0;
					}
				}
			}
			if((*Player).jumpFlag)
				jump(Player);
			else if(Player->jumpDir == -1){
				Gravity(Player);
			}
			else if(GPIO_PORTB_DATA_R & Player->jumpButton){
				(*Player).jumpFlag = 1;
				Change_Sprite(Player, JumpUp[Player->colour]);
				jump(Player);
			}
			(*Player).jumpSickness = 4;
		}else{
			(*Player).jumpSickness--;
		}
		Collisions(Player, playerNum, yAxis, Player->jumpDir);
		if(gameOverFlag == 0){
		gameOverFlag = 1;
		return;
		}
}
