void Move_Platform(mPlatform *platform){
	if(platform->movement)
	{
		if(platform->moveSickness == 0){
			uint16_t *dim;
			uint8_t axis = platform->axis;
			int16_t move = platform->dir;
			if(axis)
				dim = &platform->image->y;
			else
				dim = &platform->image->x;
			*dim += move;
			if(platform->standing1)
				Move_Player_On_Platform(&Player1, platform, axis, move, 1);
			if(platform->standing2)
				Move_Player_On_Platform(&Player2, platform, axis, move, 2);
			if(axis){
				if(*dim == platform->max ||*dim == platform->min /*&& move == -1*/)
					platform->movement = 0;
				/*else if(*dim == platform->min && move == 1)
					platform->movement = 0;*/
			}
			else{
				if(*dim == platform->max || *dim == platform->min  /*&& move == 1*/)
					platform->movement = 0;
				/*else if(*dim == platform->min && move == -1)
					platform->movement = 0;*/
			}
			platform->moveSickness = 4;
			Draw_Sprite(platform->image);
		}else{
			platform->moveSickness --;
		}
	}
}

void Move_Player_On_Platform(Player *player, mPlatform *platform, uint8_t axis, int16_t move, uint8_t playerNum){
	if(!Sprite_Gravity(*player->image, *platform->image)){
		if(playerNum == 1)
			platform->standing1 = 0;
		else
			platform->standing2 = 0;
	}else{
		if(axis)
			player->image->y += move;
		else
			player->image->x += move;
		Draw_Sprite(player->image);
	}
}
//Bullet Engine
void Move_Bullet(Bullet *bullet){
	if(bullet->movesickness==0){
		Sprite *temp = bullet->image;
		temp->x += bullet->dir;
		if(temp->x == bullet->max){
			ST7735_FillRect(temp->x, temp->y - temp->l + 1, temp->w, temp->l, 0xFFFF);
			temp->x = bullet->min;
			Change_Sound(1);
		}
		Draw_Sprite(bullet->image);
		bullet->movesickness = 4/bullet->v;
	}
	else
		bullet->movesickness--;
}
