unsigned short lfsr = 0xACE1u;
unsigned bit;

unsigned rand(){
	bit  = ((lfsr >> 0) ^ (lfsr >> 2) ^ (lfsr >> 3) ^ (lfsr >> 5) ) & 1;
	return lfsr =  (lfsr >> 1) | (bit << 15);
}
	
void Generate_Race(void){
	ST7735_FillScreen(0xFFFF);
	Draw_Rect(&raceRects->rects[0]);
	Draw_Rect(&raceRects->rects[1]);
	uint8_t i, x = 2;
	uint16_t r;
	for(i = 45; i < 120; i ++){
		r = rand();
		if(r < 6553){
			raceRects->rects[x] = (rect){i,65,5,10,0};
			Draw_Rect(&raceRects->rects[x]);
			x++;
			raceRects->rects[x] = (rect){i,145,5,10,0};
			Draw_Rect(&raceRects->rects[x]);
			x++;
			i += 20;
		}
		else if(r < 1307){
			raceRects->rects[x] = (rect){i,60,5,15,0};
			Draw_Rect(&raceRects->rects[x]);
			x++;
			raceRects->rects[x] = (rect){i,140,5,15,0};
			Draw_Rect(&raceRects->rects[x]);
			x++;
			i+= 20;
		}
	}
	raceRects->size = x;
	Reset_Players();
	Player1.image->x = 0;
	Player1.image->y = 74;
	Player2.image->x = 0;
	Player2.image->y = 154;
	Draw_Sprite(Player1.image);
	Draw_Sprite(Player2.image);
}

