void JetPack_Move(Player *player, uint8_t playerNum){
	xAxis_Move(player, playerNum);
	int8_t dir;
	if(player->jumpSickness == 0){
		if(GPIO_PORTB_DATA_R & player->jumpButton){
			Change_Sprite(player, JumpUp[player->colour]);
			player->image->y --;
			dir = 1;
		}
		else if(GPIO_PORTB_DATA_R & (player->jumpButton >>1)){
			Change_Sprite(player, JumpDown[player->colour]);
			player->image->y ++;
			dir = -1;
		}
		Collisions(player, playerNum, yAxis, dir);
		player->jumpSickness = 3;
	}
	else
		player->jumpSickness--;
	if(player->image->x + player->image->w > 128)
		JetPack_Win();
	Draw_Sprite(player->image);
}

