void xAxis_Move_Arena(Player *player, uint8_t playerNum){
	ADC_In89(ADCData);
	uint32_t move = ADCData[2-playerNum];
	int8_t dir = 0;
	if((*player).moveSickness == 0){
		if(move <  1536){
		(*(*player).image).x += -1;
		(*player).moveSickness = 4;
		dir = -1;
		if(!player->jumpFlag && player->facing == right)
			Change_Sprite(player, Left[player->colour]);
			player->facing = left;
		}
		else if(move > 2560){
		(*(*player).image).x += 1;
		(*player).moveSickness = 4;
		dir = 1;
		if(!player->jumpFlag && player->facing == left){
			player->facing = right;
			Change_Sprite(player, Right[player->colour]);
			}
		}
	}
	else
		(*player).moveSickness --;
	Battle_Arena_Collision(player, playerNum, xAxis, dir);
}
void Arena_Jump(Player *Player, uint8_t playerNum){
	if((*Player).jumpSickness == 0){
			if(Player->jumpDir && !Player->jumpFlag){
				if(Gravity_Check(Player, playerNum)){
					Gravity_Start(Player);
					Gravity(Player);
				}
			}
			if((*Player).jumpFlag)
				jump(Player);
			else if(Player->jumpDir == -1){
				Gravity(Player);
			}
			else if(GPIO_PORTB_DATA_R & Player->jumpButton){
				(*Player).jumpFlag = 1;
				Change_Sprite(Player, JumpUp[Player->colour]);
				jump(Player);
			}
			(*Player).jumpSickness = 4;
		}else{
			(*Player).jumpSickness--;
		}
		Battle_Arena_Collision(Player, playerNum, yAxis, Player->jumpDir);
}
void Battle_Arena_Collision(Player *Collided, uint8_t playerNum, uint8_t axis, int8_t dir){
	int8_t pCollision;
	if(playerNum == 1){
		if(Sprite_Collision(*Collided->image, *levelSprites[1])){
			PlayerC_Handler(Collided, levelSprites[1], axis, dir);
			return;
		}
	}else if(playerNum == 2){
		if(Sprite_Collision(*Collided->image, *levelSprites[0])){
			PlayerC_Handler(Collided, levelSprites[0], axis, dir);
			return;
		}
	}
	pCollision = Collision_Checker_Platform(Collided->image);
	if(pCollision != -1)
		Collision_Handler_Platform(Collided, pCollision, axis, dir);
}

void Update_Battle_Arena(void){
	if(GPIO_PORTB_DATA_R & 0x40){
		if(ba00.v == 0 && ba01.v == 0){
			if(Player1.facing == left){
				ba00.image->x = Player1.image->x - 14;
				ba00.image->y = Player1.image->y - 3;
				ba00.v = 1;
				Bullet_Arena_Collisions(&ba00, 0);
			}else{
				ba01.image->x = Player1.image->x + 2 + Player1.image->w;
				ba01.image->y = Player1.image->y - 3;
				ba01.v = 1;
				Bullet_Arena_Collisions(&ba01, 0);
			}
		}
	}
	else if(GPIO_PORTB_DATA_R & 0x8){
		if(ba02.v == 0 && ba03.v == 0){
			if(Player2.facing == left){
				ba02.image->x = Player2.image->x - 14;
				ba02.image->y = Player2.image->y - 3;
				ba02.v = 1;
				Bullet_Arena_Collisions(&ba02, 0);
			}else{
				ba03.image->x = Player2.image->x + 2 + Player1.image->w;
				ba03.image->y = Player2.image->y - 3;
				ba03.v = 1;
				Bullet_Arena_Collisions(&ba03, 0);
			}
		}
	}
	if(ba00.v != 0)
		Move_Bullet_Arena(&ba00, 2);
	else if(ba01.v != 0)
		Move_Bullet_Arena(&ba01, 2);
	
	if(ba02.v != 0)
		Move_Bullet_Arena(&ba02, 1);
	else if(ba03.v != 0)
		Move_Bullet_Arena(&ba03, 1);
}

void Move_Bullet_Arena(Bullet *bullet, uint8_t playerNum){
	if(bullet->movesickness==0){
		Sprite *temp = bullet->image;
		temp->x += bullet->dir;
		if(temp->x == bullet->max){
			ST7735_FillRect(temp->x, temp->y - temp->l + 1, temp->w, temp->l, 0xFFFF);
			temp->x = bullet->min;
			Change_Sound(1);
		}
		Bullet_Arena_Collisions(bullet, 1);
		Draw_Sprite(bullet->image);
		bullet->movesickness = 4/bullet->v;
	}
	else
		bullet->movesickness--;
	if(playerNum == 2 && Sprite_Collision(*bullet->image, *Player2.image))
		Battle_Arena_Win(2);
	else if(Sprite_Collision(*bullet->image, *Player1.image))
		Battle_Arena_Win(1);
}

void Bullet_Arena_Collisions(Bullet *bullet, uint8_t fill){
	int8_t pCollision;
	Sprite *temp = bullet->image;
	pCollision = Collision_Checker_Platform(temp);
		if(pCollision != -1 || temp->x > 128){
			if(fill)
				ST7735_FillRect(temp->x, temp->y - temp->l + 1, temp->w, temp->l, 0xFFFF);
			*temp = (Sprite){150, 180, &BulletBill2[0], 12, 7, bulletC};
			bullet->v = 0;
		}
}

uint8_t battleMenu, selectionButtonB, currentSelectedB;
void Battle_Arena_Win(uint8_t playerNum){
	bab00 = (Sprite){150, 180, &BulletBill[0], 12, 7, bulletC};
	ba00.v = 0;
	bab01 = (Sprite){150, 180, &BulletBill2[0], 12, 7, bulletC};
	ba01.v = 0;
	bab02 = (Sprite){150, 180, &BulletBill[0], 12, 7, bulletC};
	ba02.v = 0;
	bab03 = (Sprite){150, 180, &BulletBill2[0], 12, 7, bulletC};
	ba03.v = 0;
	Change_Sound(4);
	ST7735_FillRect(20,25,90,25, 0);
	ST7735_FillRect(20,105,30,25, 0);
	char *gameOverText = "Game Over";
	char *playerOneWins = "Player 1 Wins";
	char *playerTwoWins = "Player 2 Wins";
	char *yes = "Yes";
	char *no = "No";
	ST7735_SetCursor(4,3);	
	ST7735_OutString(gameOverText);
	ST7735_SetCursor(4,4);
	if(playerNum == 1)
		ST7735_OutString(playerTwoWins);
	else
		ST7735_OutString(playerOneWins);
	ST7735_SetCursor(4,5);	
	ST7735_OutString(yes);
	ST7735_SetCursor(4,6);
	ST7735_OutString(no);
	arrowSprite.y = 57;
	Draw_Sprite(&arrowSprite);
	buttonFlag = 0;
	currentSelectedB = 0;
	selectionButtonB = 0;
	battleMenu = 1;
	while(battleMenu){
		M = 1;
		selectionButtonB = GPIO_PORTB_DATA_R & 0x80; //Checks if select button is pressed
		if(selectionButtonB){
			if(currentSelectedB)
				battleArena = 0;
				battleMenu = 0;
		}
		currentSelectedB = Update_Battle_Menu(currentSelectedB);
		FrameRateDelay(FrameRate);
	}
	if(battleArena){
		Reset_Players();
		Player2.image = &RedGirlLeftSprite;
		Player2.image->x = 100;
		Player2.facing = left;
		Generate_Level(cLevel, cStage);
		FrameRateDelay(1);
		FrameRateDelay(1);
		FrameRateDelay(1);
		FrameRateDelay(1);
	}
}

uint8_t Update_Battle_Menu(uint8_t cS){
	uint8_t button = GPIO_PORTB_DATA_R & 0x40;
	if(button != buttonFlag){
		buttonFlag = button;
		if(button){
			ST7735_FillRect(5,12*cS + 48,15,12,0);
			cS = (cS+1) % 2;
			arrowSprite.y += 12;
			if(arrowSprite.y == 81)
				arrowSprite.y = 57;
			Draw_Sprite(&arrowSprite);
		}
	}
	if(heartbeat == 0){
		PF2 ^= 0x4;
		heartbeat = 1000;
	}
	else
		heartbeat --;
	return cS;
}
//Timer Updated by Timer Interrupt 
//change player controller, triggered by button
void Swap_Player(void){
		Sprite *temp = Player1.image;
		Player1.image = Player2.image;
		levelSprites[0] = Player2.image;
		Player2.image = temp;
		levelSprites[1] = temp;
		Player1.colour = (Player1.colour + 1)&0x1;
		Player2.colour = (Player2.colour + 1)&0x1;
}

//pause game till button pressed again to unpause
void Pause(void){
	pauseStatus ^= 0x1;
	PF2 = 0;
	while(pauseStatus&0x1){
		if(Button_Flag == 1)
			Button_Pressed();
	}
}


//check which button was pressed over UART
void Button_Pressed(void){
	char function, consume;
	Button_Flag = 0;
	while(FiFo_Get(&function) == 0){};
	while(function != 0x2){
	FiFo_Get(&function);
	}
	FiFo_Get(&function);
	FiFo_Get(&consume);
	FiFo_Get(&consume);
	FiFo_Get(&consume);
	FiFo_Get(&consume);
	FiFo_Get(&consume);
	FiFo_Get(&consume);
	if (function == 'M'){
		M = 0;
	}else if(function == 'P'){
		Pause();
	}else if (function == 'S'){
		Swap_Player();
	}else if (function == 'R'){
		Reset();
	}
}


//tell MC2 to change song/sound
//>06 is sound effect
//<06 is song change
void Change_Sound(uint8_t data){
	UART_OutChar(0x2);
	UART_OutChar(data);
	UART_OutChar('0');
	UART_OutChar('0');
	UART_OutChar('0');
	UART_OutChar('0');
	UART_OutChar('0');
	UART_OutChar(0x3);
}
